#FUNCTIONS------------------------------------------------------------------
def check_projection(shapefile):
    """
    Checks the projection of the given shapefile.

    Parameters:
    shapefile (str): The name of the shapefile

    Raises:
    Exception: If no .prj file is found or if the projection is not RD_New
    """  
    prj_file = shapefile.replace('.shp', '.prj')
    try:
        with open(prj_file, 'r') as file:
            data = file.read().replace('\n', '')
    except FileNotFoundError:
        print(f"No .prj file found for {shapefile}")
        raise Exception("No projection found. Please ensure the projection is RD_New (also known as Rijksdriehoeksstelsel).")
        
    if "PROJCS[\"RD_New\"" not in data:
        print(f"The projection of {shapefile} is not RD_New.")
        raise Exception("Invalid projection. Please change the projection to RD_New (also known as Rijksdriehoeksstelsel).")
    
    print(f"The projection of {shapefile} is RD_New. Proceeding...")

def get_extent(shapefile_name):
    """
    Get the extent of the shapefile.

    Parameters:
    shapefile_name (str): The name of the shapefile

    Returns:
    tuple: A tuple containing xmin, ymin, xmax, ymax
    """
    with open(shapefile_name, 'rb') as f:
        f.seek(36)
        bytes = f.read(8 * 4)
        xmin, ymin, xmax, ymax = struct.unpack("<4d", bytes)
        return xmin, ymin, xmax, ymax

def get_overlapping_squares(extent, ahn_bladindex):
    """
    Finds overlapping squares between the given extent and the AHN bladindex.

    Parameters:
    extent (list): A list containing xmin, ymin, xmax, ymax of the shapefile
    ahn_bladindex (dict): A dictionary containing the AHN bladindex

    Returns:
    list: A list of overlapping bladindexes
    """
    x_min_extent, y_min_extent, x_max_extent, y_max_extent = extent

    overlapping_squares = []

    for key, value in ahn_bladindex.items():
        x_min_square = value['x_min']
        y_min_square = value['y_min']
        x_max_square = value['x_max']
        y_max_square = value['y_max']

        if x_min_extent <= x_max_square and x_max_extent >= x_min_square and \
           y_min_extent <= y_max_square and y_max_extent >= y_min_square:
            overlapping_squares.append(key.upper())

    return overlapping_squares

def get_user_choice():
    """
    Interactively gets the user's choice.

    Returns:
    str: The choice of the user
    """
    valid_choices = ["05m_dsm", "05m_dtm"]
    while True:
        user_choice = input("Please choose one from '05m_dsm', '05m_dtm': (the standard in hydrological projects is '05m_dtm')")
        if user_choice in valid_choices:
            return user_choice
        else:
            print("Invalid choice. Please try again.")

